import React, { useState } from "react";
import list from "../JsonFiles/listApi.json";
import img_0 from '../components/images/img_1.png';
import img_1 from '../components/images/img_2.png';
import img_2 from '../components/images/img_3.png';
import img_3 from '../components/images/img_4.png';
import img_4 from '../components/images/img_5.png';

function About() {
  const img = [img_0,img_1,img_2,img_3,img_4];
  const[Intialobject,setInitial] = useState(list);
  const[searchlist,setSearchList] = useState([]);
  // const data = ["Bulbasaur","Ivysaur","Venusaur","Charmander","Charmeleon","Charizard","Squirtle","Wartortle","Blastoise","Caterpie","Metapod","Butterfree",
  //                "Weedle","Kakuna","Beedrill","Pidgey","Pidgeotto","Pidgeot","Rattata","Raticate","Spearow","Fearow","Ekans","Arbok","Pikachu","Raichu","Sandshrew",
  //                "Sandslash","Nidoran♀","Nidorina","Nidoqueen","Nidoran♂","Nidorino","Nidoking","Clefairy","Clefable","Vulpix","Ninetales","Jigglypuff","Wigglytuff",
  //                "Zubat","Golbat","Oddish","Gloom","Vileplume","Paras","Parasect","Venonat","Venomoth","Diglett","Dugtrio","Meowth","Persian","Psyduck","Golduck","Mankey",
  //                "Primeape","Growlithe","Arcanine","Poliwag","Poliwhirl","Poliwrath","Abra","Kadabra","Alakazam","Machop","Machoke","Machamp","Bellsprout","Weepinbell","Victreebel",
  //                "Tentacool","Tentacruel","Geodude","Graveler","Golem","Ponyta","Rapidash","Slowpoke","Slowbro","Magnemite","Magneton","Farfetch'd","Doduo","Dodrio","Seel","Dewgong","Grimer",
  //                "Muk","Shellder","Cloyster","Gastly","Haunter","Gengar","Onix","Drowzee","Hypno","Krabby","Kingler","Voltorb","Electrode","Exeggcute","Exeggutor","Cubone","Marowak","Hitmonlee",
  //                "Hitmonchan","Lickitung","Koffing","Weezing","Rhyhorn","Rhydon","Chansey","Tangela","Kangaskhan","Horsea","Seadra","Goldeen","Seaking","Staryu","Starmie","Mr. Mime","Scyther",
  //                "Jynx","Electabuzz","Magmar","Pinsir","Tauros","Magikarp","Gyarados","Lapras","Ditto","Eevee","Vaporeon","Jolteon","Flareon","Porygon","Omanyte","Omastar","Kabuto","Kabutops",
  //                "Aerodactyl","Snorlax","Articuno","Zapdos","Moltres","Dratini","Dragonair","Dragonite","Mewtwo","Mew",
  // ];
   const data = list.assetInfo;

  const[pkmn,setpkmn] = useState(data);
  const searchData = (e) => {
      var queryData = [];
      if(e.target.value != '') {
        pkmn.forEach(function(person) {
          if(person.name.toLowerCase().includes(e.target.value) ) {
            if(queryData.length < 10) {
              queryData.push(person);
            }
          }
      });
    }
    setSearchList(queryData);
  }
  return (
    <div className="about">
      <div class="container">
        <div className="row mt-5">
        <div className="col-md-10 col-sm-10 col-10">
        <div class="input-group md-form form-sm form-2 pl-0">
  <input class="form-control my-0 py-1 red-border" type="text" placeholder="Search" aria-label="Search" onChange={(e) =>{ searchData(e) }} />
  <div class="input-group-append">
    <span class="input-group-text red lighten-3" id="basic-text1"><i class="fa fa-search text-grey"
        aria-hidden="true"></i></span>
  </div>
</div>

      </div>
        <div className="row">
        {
          searchlist.map((items,key) => {
            return (
                <div className="row d-flex">
                   <div className="col-md-10 col-sm-10 col-10">
                   <img src= {img[key]} alt={items.name} width="35px" />{items.name}
                   </div>
                   <div className="col-md-2 col-sm-2 col-2">
                     <div>{`${items.current} USD`}</div>
                     <div className={ items.per > 0 ? "text-success" : "text-danger" }>{`${items.diffValue}USD  (${items.per})`}</div>
                   </div>
                </div>
                );   
        })}
        </div>
        </div>
      </div>
    </div>
  );
}

export default About;
